// Imports
import React from "react";

// Component 
const Descripcion = () => {
    return(
        <React.Fragment>
            <div>
                <h4>Titulo de la descripcion</h4>
                <p>Descripcion 1</p>
                <p>Descripcion 2</p>
                <p>Descripcion 3</p>
            </div>
        </React.Fragment>
    );
}

// Exports
export {Descripcion};
